import React, { useState } from 'react'
import Input from './Input'

const Form=()=> {
    const[value, setValue] =useState("")
    const handleChange =(e)=>{
        setValue(e.target.value)
    }
    return (
        <div>
            <Input
                name="employee-form"
                value ={value}
                handleChange = {handleChange}
             />
        </div>
    )
}

export default Form
